export default function Pagination(props) {
  return (
    <div>
        <nav aria-label="Page navigation example">
            <ul class="pagination justify-content-center">
                <li class="page-item"><a class="page-link bg-danger text-light" href="#">Previous</a></li>
                <li class="page-item"><p class="page-link bg-danger text-light">{props.current_page}</p></li>
                <li class="page-item"><a class="page-link bg-danger text-light" href="#">Next</a></li>
            </ul>
        </nav>
    </div>
  )
}
